import "./ExpenseGenerator.css";

function ExpenseGenerator() {
  return (
    <div className="expense-item">
      <div>
        <h2>Expense Item!</h2>
      </div>
      <div>Oct 10th,2022</div>
      <div>Dinner</div>
      <div>$692</div>
    </div>
  );
}

export default ExpenseGenerator;
